import React from "react";
import DataTable from "../../../services/reactTable";

const Table = props => {
  let header = [
    {
      Header: "Style ID",
      accessor: "style_id"
    },
    {
      Header: "Style Description",
      accessor: "style_desc"
    }
  ];
  let data = [
    {
      style_id: "abc",
      style_desc: "def"
    },
    {
      style_id: "abc",
      style_desc: "def"
    },
    {
      style_id: "abc",
      style_desc: "def"
    }
  ];
  return <DataTable columns={header} data={data} />;
};

export default Table;
